description:
A woman feels alone and gives in to her lover, a husband treats his (bad) business with strippers in a club, a prostitute serves as currency for exchange contract, a secretary with glasses comforts her boss, Toni and Marco do not seem to care that their business is in trouble. But especially the local godfather money is not coming and the boss does not appreciate being made fun of. For those who lived in luxury and lust, their troubles are just beginning...(Google Translation) 

